import React from 'react';
import 'C:\Users\Ap\Documents\GitHub\IGN Website\Codefoo-Frontend\ignweb\src\styles\que.css';

function QuedVideos(thumbnail,time,title,) {
    return (
        <div className="queue">
            <div className="thumbWrapper">
                <img className="thumb" src = {thumbnail}/>
                <span className="time">{time}</span>
            </div>
            <span className="title">{title}</span>
        </div>
    );
}

export default QuedVideos;
